<blockquote><strong>Hur konstaterar jag felkoder? Varför piper det på displayen och blinkar rött? </strong></blockquote>
Alla felkoder har ett speciellt ljudindikation som signalerar respektive felkod i form av " lång pipljud " och direkt efter med "korta pipljud" . <em>Exempelvis : Error 14 ( 1 x Lång pipljud och 4 x korta pipljud )</em> . Det finns ett flertal applikationer man kan ta hjälp av för att tyda felkoder. ( Xiaoflasher , M365 Dashboard , etc) .
<blockquote><strong>Använd medföljande laddaren till att felsöka ! </strong></blockquote>
Den medföljande laddaren från Xiaomi hjälper till med att felsöka bland annat stömfel i batteri eller om moderkortet behöver ses över.  Om laddaren lyser grönt vi första kontakt med scootern är det troligtvis fel på följande : Batteri alternativ morderkort.
